mapper.select:

select 

,

from tbsellreceive
where fiPaymentType = #{fiPaymentType,jdbcType=INTEGER}
  and fiSeq = #{fiSeq,jdbcType=INTEGER}
  and fsCheckBillNo = #{fsCheckBillNo,jdbcType=VARCHAR}
  and fsSellNo = #{fsSellNo,jdbcType=VARCHAR}
  and fsShopGUID = #{fsShopGUID,jdbcType=VARCHAR}

mapper.delete:

delete from tbsellreceive
where fiPaymentType = #{fiPaymentType,jdbcType=INTEGER}
  and fiSeq = #{fiSeq,jdbcType=INTEGER}
  and fsCheckBillNo = #{fsCheckBillNo,jdbcType=VARCHAR}
  and fsSellNo = #{fsSellNo,jdbcType=VARCHAR}
  and fsShopGUID = #{fsShopGUID,jdbcType=VARCHAR}
